import React, {FC} from 'react';
import axios from "axios";

interface State {
    _id: string
    name: string
    type: string
    proteins: number
    fat: number
    carbohydrates: number
    calories: number
    price: number
    image: string
    image_mobile: string
    image_large: string
    __v: number


}

async function getState(url: string, setter: Function): Promise<State> {
    axios.get(url).then(response => {
            setter(response.data.data)
        }
    )
}

const App: FC = () => {

    const url: string = 'https://norma.nomoreparties.space/api/ingredients'

    const [stateMy, setState] = React.useState([])

    // @ts-ignore
    React.useEffect(
        () => {
            getState(url, setState)

        }, []
    )

    const e = () => {
        console.log(stateMy)
    }


    return (
        <div className="App">
            <button onClick={e}/>
        </div>
    );
}

export default App;
